import React from 'react';
import './IconButton.css';
import planeIcon from '/home/uthso/Documents/Code/Projects_and_codes/React/MUI/my-app/src/assets/flight_white_24dp.svg';

const IconButton = () => {
  return (
    <div className="icon-button">
      <button className="plane-icon-button">
        <img src={planeIcon} alt="Plane Icon" className="plane-icon" />
      </button>

      <button className="plane-icon-button reverse">
        <img src={planeIcon} alt="Plane Icon" className="plane-icon" />
      </button>
    </div>
  );
};

export default IconButton;
